def gcd(a: int, b: int) -> int:
    """
    Computes the greatest common divisor (GCD) of two integers a and b.

    Parameters:
    a (int): The first integer.
    b (int): The second integer.

    Returns:
    int: The GCD of a and b.
    """
    if a > b:
        (a, b) = (b, a)
    if b % a == 0:
        return a
    return gcd(b % a, a)

